import React, { useState, useEffect } from "react";
import { fetchTrades, fetchWatch } from "./ApiCalls";
import { successModal, unsuccessModal } from "./Utility"; // Assuming you have modals to handle success and error states

const Watchlist = () => {
  const [watchlist, setWatchlist] = useState([]);
  const [error, setError] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [selectedWatch, setSelectedWatch] = useState(null);
  const [showEditModal, setShowEditModal] = useState(false);
  const [formData, setFormData] = useState({
    dates: "",
    symbol: "",
    price: "",
    target_price: "",
    exp_date: "",
    plan: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (showEditModal) {
      setSelectedWatch({ ...selectedWatch, [name]: value });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  // Fetch watchlist data from API
  const fetchWatchData = async () => {
    try {
      const watchdata = await fetchWatch();
      setWatchlist(watchdata);
      successModal();
    } catch (error) {
      setError(error.message);
      unsuccessModal(error.message);
    }
  };

  useEffect(() => {
    fetchWatchData();
  }, []);

  const handleItemClick = (watch) => {
    setSelectedWatch(watch);
    setShowEditModal(true);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:8000/watchlist/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ ...formData }),
      });
      console.log(formData);
      if (!response.ok) {
        throw new Error("Failed to add Watchlist Item");
      }
      successModal();
      setShowModal(false);
      setFormData({
        dates: "",
        symbol: "",
        price: "",
        target_price: "",
        exp_date: "",
        plan: "",
      });
      fetchWatchData();
    } catch (error) {
      console.log("Error adding watchlist: ", error);
    }
  };

  const handleEditSubmit = async (e) => {
    e.preventDefault();
    try {
      const formattedWatchlist = {
        id: selectedWatch.id,
        symbol: selectedWatch.symbol,
        price: selectedWatch.price,
        target_price: selectedWatch.target_price,
        exp_date: selectedWatch.exp_date,
        plan: selectedWatch.plan,
      };
      const response = await fetch(
        `http://localhost:8000/watchlist/${selectedWatch.id}`,
        {
          method: "PUT",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(formattedWatchlist),
        }
      );
      if (!response.ok) {
        throw new Error("Failed to update Watchlist");
      }
      successModal();
      setShowEditModal(false);
      fetchWatchData();
    } catch (error) {
      console.log("Error updating Watchlist: ", error);
    }
  };

  useEffect(() => {
    if (selectedWatch) {
      setSelectedWatch({ ...selectedWatch, ...formData });
    }
  }, [formData]);

  return (
    <div className="watchlist">
      <div className="header">
        <p>Watchlist</p>
        <i
          className="fa-solid fa-plus"
          id="new-btn"
          onClick={() => setShowModal(true)}
        ></i>
      </div>
      <div className="list">
        <ul className="item">
          {watchlist.map((entry, index) => (
            <li
              key={index}
              className="card-content"
              onClick={() => handleItemClick(entry)}
            >
              <div className="left">
                <p className="symbol">{entry.symbol}</p>
              </div>
              <div className="right">
                <p className="dates">
                  Date: {entry.dates?.split("-").slice(1).join("/")}
                </p>
                <p className="price">Price: ${entry.price}</p>
                <p className="target-price">Target: ${entry.target_price}</p>
                <p className="exp-date">
                  Expiry: {entry.exp_date?.split("-").slice(1).join("/")}
                </p>
              </div>
            </li>
          ))}
        </ul>
      </div>
      {showModal && (
        <div className="form-modal">
          <div className="form-modal-content">
            <div className="header">
              <p>Watchlist</p>
              <span className="close" onClick={() => setShowModal(false)}>
                &times;
              </span>
            </div>
            <form className="new-trade-form" onSubmit={handleSubmit}>
              <label htmlFor="dates">Date:</label>
              <input
                type="date"
                name="dates"
                value={formData.dates}
                onChange={handleChange}
              />

              <label htmlFor="symbol">Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={formData.symbol}
                onChange={handleChange}
              />

              <label htmlFor="price">Price:</label>
              <input
                type="text"
                name="price"
                value={formData.price}
                onChange={handleChange}
              />

              <label htmlFor="target_price">Target Price:</label>
              <input
                type="text"
                name="target_price"
                value={formData.target_price}
                onChange={handleChange}
              />

              <label htmlFor="exp_date">Exp. Date:</label>
              <input
                type="date"
                name="exp_date"
                value={formData.exp_date}
                onChange={handleChange}
              />

              <label htmlFor="plan">Plan:</label>
              <input
                type="text"
                name="plan"
                value={formData.plan}
                onChange={handleChange}
              />

              <button type="submit">Add</button>
            </form>
          </div>
        </div>
      )}
      {showEditModal && (
        <div className="form-modal">
          <div className="form-modal-content">
            <div className="header">
              <p>Edit Watchlist</p>
              <span className="close" onClick={() => setShowEditModal(false)}>
                &times;
              </span>
            </div>
            <form className="edit-trade-form" onSubmit={handleEditSubmit}>
              <label htmlFor="dates">Date:</label>
              <input
                type="date"
                name="dates"
                value={selectedWatch.dates}
                onChange={handleChange}
              />

              <label htmlFor="symbol">Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={selectedWatch.symbol}
                onChange={handleChange}
              />

              <label htmlFor="price">Price:</label>
              <input
                type="text"
                name="price"
                value={selectedWatch.price}
                onChange={handleChange}
              />

              <label htmlFor="target_price">Target Price:</label>
              <input
                type="text"
                name="target_price"
                value={selectedWatch.target_price}
                onChange={handleChange}
              />

              <label htmlFor="exp_date">Exp. Date:</label>
              <input
                type="date"
                name="exp_date"
                value={selectedWatch.exp_date}
                onChange={handleChange}
              />

              <label htmlFor="plan">Plan:</label>
              <input
                type="text"
                name="plan"
                value={selectedWatch.plan}
                onChange={handleChange}
              />

              <button type="submit">Update</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default Watchlist;
